import React from 'react'
import { Link, useNavigate } from 'react-router-dom'

import { useSelector } from 'react-redux';
import { getLocal } from '../helpers/auth';
import jwt_decode from "jwt-decode"









function Navbar() {

    const { username } = jwt_decode(getLocal())
    const history = useNavigate()
    const { user, count } = useSelector((state) => state.auth);

    const logout = () => {
        localStorage.removeItem('authToken')
        history('/login')
    }

    return (
        <div>
            <nav class="navbar navbar-light bg-light justify-content-between">
                <p class="navbar-brand"><Link className='nav-items' to='/'>Home</Link></p>
                <form class="form-inline">
                    <i class="bi bi-person"></i>


                    {username && <button onClick={logout} class="btn btn-outline-danger my-2 my-sm-0" type="submit">LOGOUT</button>}
                    <i class="bi bi-person"></i>
                    
                    <svg xmlns="http://www.w3.org/2000/svg" width="16" height="16" fill="currentColor" class="bi bi-person" viewBox="0 0 16 16">
                        <path d="M8 8a3 3 0 1 0 0-6 3 3 0 0 0 0 6Zm2-3a2 2 0 1 1-4 0 2 2 0 0 1 4 0Zm4 8c0 1-1 1-1 1H3s-1 0-1-1 1-4 6-4 6 3 6 4Zm-1-.004c-.001-.246-.154-.986-.832-1.664C11.516 10.68 10.289 10 8 10c-2.29 0-3.516.68-4.168 1.332-.678.678-.83 1.418-.832 1.664h10Z" />
                    </svg>


                </form>
            </nav>
        </div>
    )
}

export default Navbar
